comments:
I've been involved in animal rescue in some shape or form for the past 5 years. I started with photographing the animals, then networking, fostering, coordinating with rescues and transporters, transporting and then took a 2 year break. I came back a few months ago with photographing and networking. And now, here we are. Clarabelle. Dogs like her are why I'm a failure at fostering. She's perfect. 8 month old beagle mix, doesn't bark, only whines to go potty, calm, friendly, loves to cuddle.....and has made me fall 100% in love with her. She's scheduled to leave for her rescue in MN Saturday morning. Ever fiber of my being literally aches when I think that I'll never see her again. Never rub her velvety soft ears or kiss her cold little nose. I've watched her evolve over the past week from an abused, terrified, chicken eating puppy to a happy, loving, cheeseball obsessed pup. She refused to walk into our house for the first 2 days and had to be carried through the door. Now she's perfectly at home and thinks she runs the place. She belongs here. We belong to her. Usually it's pretty easy to send them on their way - I trust the rescue I foster for implicitly, I know without a doubt that they will find the perfect home for each dog I send on. But sometimes I think- what if WE are the perfect home?
